script: |
  super -f text -I q1656.spq | sort > q1656.out

inputs:
  - name: q1656.spq
    data: |
      SELECT DISTINCT + + 51 AS col0, ( - + 25 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab2

outputs:
  - name: q1656.out
    data: |
      51	-25
